import React from 'react';

const InputNumber = ({ value, onChange }) => {
  return (
    <select value={value} onChange={onChange}>
      {[...Array(10).keys()].map((number) => (
        <option key={number + 1} value={number + 1}>
          {number + 1}
        </option>
      ))}
    </select>
  );
};

export default InputNumber;
